import React, { Component } from 'react'

import Logo from './logo/Logo'
import RegSMSMid from './RegSMSMid'
export default class RegSMS extends Component{
    render(){
        return(
            <div className="wrapper">
                <Logo />
                <RegSMSMid next={this.props.next} props={this.props.props}/>
            </div>  
        )
    }

}
